function Table() {
  return (
    <div style={{ border: 'solid', padding: '10px' }} id="new_contact">
      <table>
        <tr>
          <th><h3 id="create_name">Type</h3></th>
          <th><h3 id="number">Number</h3></th>
        </tr>
        <tr>
          <th>office</th>
          <th>9123</th>
          <th><button id = "dl3">delete</button></th>
        </tr>


      </table>

    </div>
  );
}

export default Table;
